import vtkCornerAnnotation from './UI/CornerAnnotation.js';
import vtkFPSMonitor from './UI/FPSMonitor.js';
import vtkIcons from './UI/Icons.js';
import vtkSlider from './UI/Slider.js';
import vtkVolumeController from './UI/VolumeController.js';

var UI = {
  vtkCornerAnnotation: vtkCornerAnnotation,
  vtkFPSMonitor: vtkFPSMonitor,
  vtkIcons: vtkIcons,
  vtkSlider: vtkSlider,
  vtkVolumeController: vtkVolumeController
};

export { UI as default };
